import { Container } from 'react-bootstrap';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';

const Footer = () => {
    return (
      <footer className="footerSection">
          <Container>
            <Row>
                <Col>
                    <FooterNavList />
                </Col>
                <Col>
                    <a className="footerLogo">
                        <img className="" src="././img/DFGP_Logo_nav.png" alt="DFGP Logo"></img>
                    </a>
                </Col>
                <Col>
                <h2>Rechtliches</h2>
                <Legal />
                </Col>
            </Row>  
          </Container>
      </footer>  
    )
}

const FooterNavList = () => {
    return (
        <ul className="navList">
           <li>Ãœber Uns</li>
           <li>Mitgliedschaft</li>
           <li>Anfahrt</li>
           <li>Liga</li> 
           <li>Aktuelles</li> 
        </ul>
    )
}

const Legal = () => 
{
    return (
        <ul>
            <li>Impressum</li>
            <li>Datenschutz</li>
        </ul>
    )
}

export default Footer;
